import React, { useState } from 'react';


const ex = ({workouts}) => {
    
    return ( <div className="ex">
        <h3>Past Workouts</h3>
        {workouts.map((workout) =>(
            <div key={workout.id}>
                <h2>{workout.type}</h2>
                <p>{workout.date}</p>
            </div>
        ))}

        </div> );
}
 
export default ex;
